import Bieudo from './components/Bieudo';
import Footer from './components/Footer';
import './index.css';
function App() {
  return (
    <div className="app-container">
      <TopNavbar />
<div style={{ padding: 8 }}>
  <MarketSummary />
</div>
<div style={{ padding: 12 }}>
  <StockChart />
</div>

      <div className="main-content">
        <div className="left-column">
          <Bieudo />
          <OrderBookTabs />
        </div>
        <div className="right-column">
          <OrderForm />
        </div>
      </div>

                <Footer />

    </div>
  );
}


